import React, {useState, useEffect} from 'react'
import './HybridData.css'

function HybridData() {

    const [data, setData] = useState([])
    const fetchData = () => {
        fetch("https://raw.githubusercontent.com/Sreekanthm7/jsondata/main/azure-json-data/data.json")
        .then((responce) => {
            return responce.json()
        })
        .then((data) => {
            setData(data.hybridData)
        })
    }

    useEffect(() => {
        fetchData()
    }, [])
    console.log(data);

  return (
   <>
    <div className='hybrid-data-container'>
        <div className='hybrid-data'>
            <div className='hybrid-section'>
                <div className='hybrid-cards'>
                    <div>

                    </div>
                </div>
            </div>
        </div>
    </div>
   </>
  )
}

export default HybridData
